(function () {
  'use strict';

  // 多重読み込み防止
  if (window.__OVERLAY_TRAIN_LOADED__) return;
  window.__OVERLAY_TRAIN_LOADED__ = true;

  // 平日のみ
  const day = new Date().getDay();
  if (!(day >= 1 && day <= 5)) return;

  const IMAGE_UP = "https://raw.githubusercontent.com/sakuraps1134/imagebox/main/upp.png
";
  const IMAGE_DOWN = "https://raw.githubusercontent.com/sakuraps1134/imagebox/main/dow.png
";

  const IMAGE_STYLE =
    "position:absolute;width:84%;height:84%;top:15%;left:15%;object-fit:contain;z-index:50;pointer-events:none;";
  const IMAGE_STYLE_COL2 =
    "position:absolute;width:72%;height:72%;top:20%;left:1%;object-fit:contain;z-index:50;pointer-events:none;";

  const TRAIN_NO_STYLE_UP =
    "position:absolute;bottom:0%;transform:translateY(-50%);right:2%;background:black;color:white;padding:1px 4px;border-radius:3px;z-index:120;pointer-events:none;font-family:inherit;font-size:10px!important;";
  const TRAIN_NO_STYLE_DOWN =
    "position:absolute;top:0%;transform:translateY(-50%)!important;right:2%;background:black;color:white;padding:1px 4px;border-radius:3px;z-index:120;pointer-events:none;font-family:inherit;font-size:11px!important;";

  const TRAIN_NO_STYLE_COL2_UP =
    "position:absolute;bottom:0%;transform:translateY(80%)!important;left:2%;background:black;color:white;padding:1px 4px;border-radius:3px;z-index:120;pointer-events:none;font-family:inherit;font-size:11px!important;";
  const TRAIN_NO_STYLE_COL2_DOWN =
    "position:absolute;top:2%;left:2%;background:black;color:white;padding:1px 4px;border-radius:3px;z-index:120;pointer-events:none;font-family:inherit;font-size:10px!important;";

  const CSV_B64 = "";
  const CSV_TEXT = atob(CSV_B64);

  let lastRenderedTime = null;

  function getCurrentTimeKey() {
    const d = new Date();
    return `${d.getHours()}:${String(d.getMinutes()).padStart(2, "0")}`;
  }

  function parseCSV(text) {
    return text.trim().split("\n").map(l => l.split(","));
  }

  function removeImages() {
    document
      .querySelectorAll(".overlay-train-image, .overlay-train-no")
      .forEach(e => e.remove());
  }

  function insertImage(dd, imgSrc, trainNoStr, isUp) {
    if (dd.querySelector(".overlay-train-image")) return;

    dd.style.position = "relative";

    const img = document.createElement("img");
    img.src = imgSrc;
    img.className = "overlay-train-image";
    img.style.cssText = dd.classList.contains("col2")
      ? IMAGE_STYLE_COL2
      : IMAGE_STYLE;

    const label = document.createElement("div");
    label.className = "overlay-train-no";
    label.textContent = trainNoStr;
    label.style.cssText = dd.classList.contains("col2")
      ? (isUp ? TRAIN_NO_STYLE_COL2_UP : TRAIN_NO_STYLE_COL2_DOWN)
      : (isUp ? TRAIN_NO_STYLE_UP : TRAIN_NO_STYLE_DOWN);

    dd.appendChild(img);
    dd.appendChild(label);
  }

  function render(force = false) {
    const now = getCurrentTimeKey();
    if (!force && now === lastRenderedTime) return;
    lastRenderedTime = now;

    removeImages();

    const table = parseCSV(CSV_TEXT);
    const header = table[0];
    const row = table.find(r => r[0] === now);
    if (!row) return;

    for (let i = 1; i < row.length; i++) {
      const cell = row[i];
      if (!cell) continue;

      const trainNoStr = header[i];
      const trainNoNum = Number(trainNoStr);
      if (Number.isNaN(trainNoNum)) continue;

      const m = cell.match(/row(\d+)\s+col(\d+)/);
      if (!m) continue;

      const dd = document.querySelector(`dd.row${m[1]}.col${m[2]}`);
      if (!dd) continue;

      const isUp = trainNoNum % 2 === 0;
      insertImage(dd, isUp ? IMAGE_UP : IMAGE_DOWN, trainNoStr, isUp);
    }
  }

  function renderAfterDomSettled() {
    const target = document.querySelector(".position-page");
    if (!target) return;

    let timer = null;
    const observer = new MutationObserver(() => {
      clearTimeout(timer);
      timer = setTimeout(() => {
        observer.disconnect();
        render(true);
      }, 120);
    });

    observer.observe(target, { childList: true, subtree: true });
  }

  function hookReloadButton() {
    if (typeof window.$ !== "function") return;
    $(document).on("click", ".reload-button", function () {
      renderAfterDomSettled();
    });
  }

  hookReloadButton();
  renderAfterDomSettled();

})();
